const PersonImage = () => {
    const image = document.createElement('div');
    image.id = "personImage";
    
    return image;
};

function showImage(image_b64) {
    var personImageDiv = document.querySelector('.personImage');
    var image = document.createElement('img');
    personImageDiv.classList.add("img");

    image.src = image_b64;
    personImageDiv.appendChild(image);
};


// Example of usage showImage function
const image_b64 = "data:image/jpeg;base64,";
showImage(image_b64);
// end of example


export default PersonImage;
